import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Accueil from './components/Accueil'; // Chemin relatif depuis src
import Appartement from './components/Appartement'; // Chemin relatif depuis src

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact component={Accueil} />
        <Route path="/appartement" component={Appartement} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
